import React from 'react';
import { motion } from 'framer-motion';
import { StarIcon, WifiIcon, TvIcon, LockClosedIcon } from '@heroicons/react/24/outline';

const RoomsSection = () => {
  const rooms = [
    {
      id: 1,
      name: 'Camera Standard',
      size: '≈20 m²',
      description: 'Cameră confortabilă cu duș, balcon și minibar, perfectă pentru oaspeții care caută confort și funcționalitate.',
      price: '65',
      currency: 'USD',
      image: 'https://images.unsplash.com/photo-1631049307264-da0ec9d70304?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80',
      features: ['Duș', 'Balcon', 'Minibar', 'Wi-Fi gratuit', 'TV Smart', 'Seif'],
      amenities: [
        { name: 'Wi-Fi', icon: WifiIcon, available: true },
        { name: 'Minibar', icon: TvIcon, available: true },
        { name: 'Balcon', icon: StarIcon, available: true },
        { name: 'Seif', icon: LockClosedIcon, available: true },
        { name: 'TV Smart', icon: TvIcon, available: true },
        { name: 'Duș', icon: StarIcon, available: true }
      ],
      rating: 4.8,
      reviews: 127
    },
    {
      id: 2,
      name: 'Camera Lux',
      size: '≈26 m²',
      description: 'Cameră spațioasă cu pat matrimonial, cadă și vedere la munte, ideală pentru oaspeții care apreciază luxul.',
      price: '95',
      currency: 'USD',
      image: 'https://images.unsplash.com/photo-1571896349842-33c89424de2d?ixlib=rb-4.0.3&auto=format&fit=crop&w=2070&q=80',
      features: ['Pat matrimonial', 'Cadă', 'Vedere la munte', 'Minibar premium', 'Wi-Fi gratuit', 'Seif'],
      amenities: [
        { name: 'Wi-Fi', icon: WifiIcon, available: true },
        { name: 'Minibar Premium', icon: TvIcon, available: true },
        { name: 'Vedere la Munte', icon: StarIcon, available: true },
        { name: 'Seif', icon: LockClosedIcon, available: true },
        { name: 'TV Smart', icon: TvIcon, available: true },
        { name: 'Cadă', icon: StarIcon, available: true }
      ],
      rating: 4.9,
      reviews: 89
    }
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2
      }
    }
  };

  const cardVariants = {
    hidden: { opacity: 0, y: 30 },
    visible: { opacity: 1, y: 0 }
  };

  return (
    <section id="rooms" className="section-padding bg-background-secondary">
      <div className="container-custom">
        {/* Section Header */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-3xl md:text-4xl lg:text-5xl font-display font-bold text-text-primary mb-4">
            Camere & Tarife
          </h2>
          <p className="text-lg text-text-light max-w-2xl mx-auto">
            Fiecare cameră a fost gândită pentru a oferi confortul și luxul pe care îl meriți, 
            cu facilități moderne și tarife competitive.
          </p>
        </motion.div>

        {/* Rooms Grid */}
        <motion.div
          variants={containerVariants}
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true }}
          className="grid grid-cols-1 lg:grid-cols-2 gap-8"
        >
          {rooms.map((room, index) => (
            <motion.div
              key={room.id}
              variants={cardVariants}
              className="bg-white rounded-2xl overflow-hidden shadow-lg card-hover"
            >
              {/* Image */}
              <div className="relative h-64 overflow-hidden">
                <img
                  src={room.image}
                  alt={room.name}
                  className="w-full h-full object-cover transition-transform duration-500 hover:scale-110"
                  loading="lazy"
                />
                <div className="absolute top-4 right-4 bg-white/90 backdrop-blur-sm rounded-full px-3 py-1 flex items-center space-x-1">
                  <StarIcon className="w-4 h-4 text-yellow-500 fill-current" />
                  <span className="text-sm font-semibold text-text-primary">{room.rating}</span>
                </div>
                <div className="absolute bottom-4 left-4 bg-primary-500 text-white px-3 py-1 rounded-lg">
                  <span className="font-bold">{room.price} {room.currency}</span>
                  <span className="text-sm">/noapte</span>
                </div>
                <div className="absolute top-4 left-4 bg-black/70 text-white px-2 py-1 rounded text-xs">
                  {room.size}
                </div>
              </div>

              {/* Content */}
              <div className="p-6">
                <h3 className="text-xl font-display font-bold text-text-primary mb-2">
                  {room.name}
                </h3>
                <p className="text-text-light mb-4 line-clamp-3">
                  {room.description}
                </p>

                {/* Features */}
                <div className="space-y-2 mb-6">
                  {room.features.map((feature, idx) => (
                    <div key={idx} className="flex items-center space-x-2 text-sm text-text-secondary">
                      <div className="w-1.5 h-1.5 bg-primary-500 rounded-full"></div>
                      <span>{feature}</span>
                    </div>
                  ))}
                </div>

                {/* Amenities Icons */}
                <div className="grid grid-cols-6 gap-2 mb-6">
                  {room.amenities.map((amenity, idx) => {
                    const IconComponent = amenity.icon;
                    return (
                      <div key={idx} className="flex flex-col items-center space-y-1">
                        <div className={`w-8 h-8 rounded-lg flex items-center justify-center ${
                          amenity.available ? 'bg-primary-100 text-primary-500' : 'bg-gray-100 text-gray-400'
                        }`}>
                          <IconComponent className="w-4 h-4" />
                        </div>
                        <span className="text-xs text-text-light text-center">{amenity.name}</span>
                      </div>
                    );
                  })}
                </div>

                {/* Reviews */}
                <div className="flex items-center justify-between text-sm text-text-light mb-4">
                  <span>{room.reviews} recenzii</span>
                  <span className="text-primary-600 font-medium">Disponibilă</span>
                </div>

                {/* CTA Button */}
                <motion.button
                  whileHover={{ scale: 1.02 }}
                  whileTap={{ scale: 0.98 }}
                  className="w-full btn-primary"
                >
                  Rezervă Camera
                </motion.button>
              </div>
            </motion.div>
          ))}
        </motion.div>

        {/* Bottom CTA */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true }}
          transition={{ duration: 0.8, delay: 0.4 }}
          className="text-center mt-12"
        >
          <p className="text-text-light mb-4">
            Nu găsești ce cauți? Contactează-ne pentru opțiuni personalizate.
          </p>
          <div className="flex flex-col sm:flex-row gap-4 justify-center items-center">
            <motion.button
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="btn-secondary"
            >
              Vezi Toate Camerele
            </motion.button>
            <motion.button
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="btn-primary"
            >
              Rezervă
            </motion.button>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default RoomsSection;
